import React from 'react';
import styled from 'styled-components';
import { Container } from '../components/StyledComponents/StyledComponents';
import PlantOfTheDay from '../components/Plant/PlantOfTheDay';
import Navigation from '../components/Navigation/Navigation';
import Footer from '../components/Footer/Footer';

const PlantPageContainer = styled(Container)`
    padding-top: 100px;
    min-height: 100vh;
    background: linear-gradient(
        to bottom,
        ${props => props.theme.colors.plant[50]},
        ${props => props.theme.colors.plant[150]},
        ${props => props.theme.colors.plant[250]},
        ${props => props.theme.colors.plant[350]},
        ${props => props.theme.colors.plant[450]},
        ${props => props.theme.colors.plant[550]},
        ${props => props.theme.colors.plant[650]},
        ${props => props.theme.colors.plant[750]}
    );
`;

const Plant = () => {
    return (
        <>
            <Navigation page="plant" />
            <PlantPageContainer>
                <PlantOfTheDay />
            </PlantPageContainer>
            <Footer />
        </>
    );
};

export default Plant;
